function mute(){
    muted = !muted;
    var src = document.getElementById('muteimg').src.split('/');
    src = src[src.length-1];
    if(src == 'mute.png'){
        src = 'nomute.png';
        alestorm.play();
    }
    else{
        src = 'mute.png';
        alestorm.pause();
    }
    document.getElementById('muteimg').src = src;

}

